import styled from 'styled-components';
import Responsive from './Responsive';
import Button from './Button';
import { Link } from 'react-router-dom';

const NavBlock = styled.div`
width:100%; 
height: 100%; 
display:flex; 
flex-direction:row;
flex-wrap: wrap; 
justify-items:flex-start;  
align-items : stretch

`;
const Wrapper = styled(Responsive)`
  height: 5rem;  
  width: 100%;
  background: red;
  display: flex;
  align-items: center;
  justify-content: space-between;
  z-index: 5;

 
`;

const Spacer = styled.div`
width:100%; 
height: 100%; 
display:flex; 
flex-direction:row;
flex-wrap: wrap; 
justify-items:flex-start;  
align-items : stretch
 
`;

const MenuInfo = styled.div`
  font-weight: 800;
  margin-right: 1rem;
`;
const Nav = () => {
    return (
        <>
        <NavBlock>
            <Wrapper>
              <MenuInfo>메뉴</MenuInfo>
            </Wrapper>
        </NavBlock>
        <Spacer/>
        </>
    );
};

export default Nav;
